import  React, { Component, useEffect, useState  } from "react";
import { Container  } from "shards-react";
import OsSdk from '../components/api/OsSdk.js';
import OutterOsSdk from '../components/api/OutterOsSdk.js';
import TestOsSdk from '../components/api/TestOsSdk.js';
import { Page, Center } from '../components/layout/Layout.js';
import { DrizzleContext } from "@drizzle/react-plugin";
import {  Loader } from 'rimble-ui';


export default class SdkPage extends Component {
   
 

state = { dataKey: null };

    async componentDidMount() {
 

        //const [loading, setLoading] = useState(false);
        //const [projectTokenIds, setprojectTokenIds] = useState([]);
        //const [projectTokenIdArray, setprojectTokenIdArray] = useState([]);
        //const fetchStats = async () => { 
   
            var proxyUrl = 'https://cors-anywhere.herokuapp.com/',
            targetUrl = 'https://api.opensea.io/api/v1/collection/';
            const collectionSlug= 'doodles-official/';
            const collection='stats';
           
            let i;
            let tokenIdArray= [];
            // console.log(tokenIdArray)
            //setprojectTokenIds(tokenIdArray);
            try {
            fetch(targetUrl + collectionSlug + collection,{header:'x-api-key:2f2a0900458f4bdfbb489680a58e7526'})
              .then(res => res.json())
              .then(
                (res) => {
                   const projectTotal =  res.stats.count;
           
                   this.setState({ projectTotal})
   
                   for (i = 0; i < projectTotal; i++) {
                   tokenIdArray.push(i)
                  }           
                  (error) => {
                    setLoading(true),
                    error;
                  }
                })   
                .then( () => {
                    const dataKey = tokenIdArray;
                    this.setState({ dataKey });
                      (error) => {
                        setLoading(true),
                        error;
                      }
                })     
                
    
     // this.setState({ dataKey });
      }
      catch (err) {
        this.setState({ errorMessage: err.message });
      }
     }
  



render() {
    return (    
            <div>
              <Page>
                <Center>       
                  <DrizzleContext.Consumer>
                    {drizzleContext => {
                     const {drizzle, drizzleState, initialized } = drizzleContext;
                        if(!initialized) {
                          return (
                            <div className="justify-content-center align-items-center mt-3">   
                              <Loader className="mx-auto" color="#007bff" size="40px" />
                            </div>
                            )
                          }                       
                          return(
                            <Container fluid className="d-flex justify-content-center main-container-pp">                               
                              {/* <OsSdk  drizzleState={drizzleState} drizzle={drizzle} tokenIdArray={this.state.dataKey} projectTotal={this.state.projectTotal} /> */}
                              <TestOsSdk  drizzleState={drizzleState} drizzle={drizzle} tokenIdArray={this.state.dataKey} projectTotal={this.state.projectTotal} />
                            </Container>
                          )
                       }
                      }  
                  </DrizzleContext.Consumer>
                </Center>
              </Page>    
            </div>
       
        );
    }

}
